  function getElementWithOptions(name, hasMany){
    var attr  = "fjs-"+ name;
    var $eles = $("[" + attr + "]");
    var options = []; 
  
    if(!$eles.length){
      return;
    }
  
    $.each($eles, function(){
      var $ele = $(this);
      var option = { ele: $ele };
      var optionStr = $ele.attr(attr);
  
      options.push(option);
  
      if(!optionStr){
        return options;
      }
  
      $.each(optionStr.split(','), function(i, opt){
        var kv = opt.split("=");
        option[kv[0]] = kv[1];
      })
    })
  
    return hasMany ? options : options[0];
  };
  
